import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { ChakraProvider } from '@chakra-ui/core';

function Top () {
  return (
    <div className="Top">
      <h1>Nothing <i>Starts</i> Finished</h1>
      <p>This website is dedicated to showing the unfinished beginnings of what looks finished today.</p>
      <p>Onwards!</p>
    </div>
  );
}

function Inter () {
  return (
    <div>
      <p>Intercom</p>
    </div>
  );
}

function Website () {
  return (
    <ChakraProvider>
      <div>
        <Top />
        <Inter />
      </div>
    </ChakraProvider>
  );
}

ReactDOM.render(
  <React.StrictMode>
    <Website />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
